class CreateData:
    def __init__(self, mysql_session, ng_connection_pool):
        self.mysql_session = mysql_session
        self.ng_connection_pool = ng_connection_pool

    def insert_nodes(self, node_list, space_name):

        # 'INSERT VERTEX t2 (name, age) VALUES "11":("n1", 12);'
        ng_session: Session = self.ng_connection_pool.get_session("root", "nebula")
        # ng_session.execute("use test_final;")
        # rrr = ng_session.execute("show tags;")
        # print(rrr.__dict__)
        if not isinstance(node_list, list):
            node_list = [node_list]
        node_tag = node_list[0].__class__.__name__

        nosql = 'INSERT VERTEX {} ( '.format(node_tag)
        values_list = ''
        for i, node in enumerate(node_list):
            values = ''
            nid = ''  # sample "11":(
            for k, v in node.__dict__.items():
                if k == "id":
                    nid = '"{}":('.format(v)
                if i == 0:
                    nosql += (k + ",")
                if type(v) == str:
                    values += '"{}",'.format(v)
                else:
                    values += '{},'.format(v)
            values = (nid + values[:-1] + " ),")
            values_list += values
        nosql = (nosql[:-1] + " ) VALUES ")
        nosql += (values_list[:-1] + ";")
        ng_session.execute("USE {}".format(space_name))
        r = ng_session.execute(nosql)
        print(node_tag, " INSERT V:", r.is_succeeded())
        # print(r.__dict__)
        if not r.is_succeeded():
            print(r.__dict__)
        ng_session.release()

    def insert_edges(self, edge_list, space_name):
        # "INSERT EDGE e2 (name, age) VALUES "11"->"13":("n1", 1);"
        ng_session: Session = self.ng_connection_pool.get_session("root", "nebula")
        if not isinstance(edge_list, list):
            edge_list = [edge_list]
        edge_type = edge_list[0].__class__.__name__

        nosql = 'INSERT EDGE {} ( '.format(edge_type)
        values_list = ''
        for i, edge in enumerate(edge_list):
            values = ''
            from_id = ''  # sample "11"
            to_id = ''  # sample "13"
            for k, v in edge.__dict__.items():
                if "from" in k:
                    from_id = '"{}"'.format(v)
                elif "to" in k:
                    to_id = '"{}"'.format(v)
                if i == 0:
                    nosql += (k + ",")

                if type(v) == str:
                    values += '"{}",'.format(v)
                elif type(v) == list:
                    values += '"{}",'.format(json.dumps(v, ensure_ascii=False))
                else:
                    values += '{},'.format(v)
            values = (from_id + "->" + to_id + ":(" + values[:-1] + " ),")
            values_list += values
            # break
        nosql = (nosql[:-1] + " ) VALUES ")
        nosql += (values_list[:-1] + ";")
        ng_session.execute("USE {}".format(space_name))
        r = ng_session.execute(nosql)
        print("{} INSERT E: {}".format(edge_type, r.is_succeeded()))
        # print(nosql)
        if not r.is_succeeded():
            print(nosql)
            print(r.__dict__)
        ng_session.release()


